lockfileVersion: '9.0'

settings:
  autoInstallPeers: true
  excludeLinksFromLockfile: false

importers:

  .:
    dependencies:
      vitest-types:
        specifier: file:..
        version: file:..

packages:

  vitest-types@file:..:
    resolution: {directory: .., type: directory}

snapshots:

  vitest-types@file:..: {}
